import React from 'react';
import Card from './Card'

const cardList = ({ people }) => {



    return(

        <div>
        {
            StarPeople.map((StarPerson, i) => {
                return (<Card 
                    key={i} 
                    name={people[i].name} 
                    height={people[i].height} 
                    mass={people[i].mass}
                    gender={people[i].gender}
                    birth_year={people[i].birth_year}
                     />
              );
             })
            }
        </div>

    );

}

export default cardList;
